import React, { useState, useEffect } from "react";
import "../style/SearchPage.css";
import "../index.css";

export default function MusicInsights() {
  const [danceabilityData, setDanceabilityData] = useState([]);
  const [loudnessData, setLoudnessData] = useState([]);
  const [audioProfilesData, setAudioProfilesData] = useState([]);

  const [error, setError] = useState("");

  // Fetch Tracks with Above-Average Danceability
  useEffect(() => {
    fetch("http://localhost:8080/aboveAverageDanceability")
      .then((res) => res.json())
      .then((data) => setDanceabilityData(data.rows || []))
      .catch((err) => {
        console.error("Error fetching danceability data:", err);
        setError("Failed to load Above-Average Danceability data.");
      });
  }, []);

  // Fetch Rank Tracks by Loudness
  useEffect(() => {
    fetch("http://localhost:8080/rankTracksByLoudness")
      .then((res) => res.json())
      .then((data) => setLoudnessData(data.rows || []))
      .catch((err) => {
        console.error("Error fetching loudness data:", err);
        setError("Failed to load Rank Tracks by Loudness data.");
      });
  }, []);

  // Fetch Top Audio Profiles by Genre
  useEffect(() => {
    fetch("http://localhost:8080/topAudioProfiles")
      .then((res) => res.json())
      .then((data) => setAudioProfilesData(data.rows || []))
      .catch((err) => {
        console.error("Error fetching audio profiles data:", err);
        setError("Failed to load Top Audio Profiles by Genre data.");
      });
  }, []);

  return (
    <div className="music-insights">
      <div id="navbar">
        <ul>
          <li><a href="http://localhost:3000/">HomePage</a></li>
          <li><a href="http://localhost:3000/sound">Sound Lab</a></li>
          <li><a href="http://localhost:3000/genre">Genre Page</a></li>
          <li><a href="http://localhost:3000/collaboration">Collaboration</a></li>
        </ul>
      </div>

      <div id="page-wrapper">
        <h1>Music Insights</h1>
        {error && <p className="error-message">{error}</p>}

        {/* Section 1: Tracks with Above-Average Danceability */}
        <section className="feature-section">
          <h2>Tracks with Above-Average Danceability</h2>
          <table className="results-table">
            <thead>
              <tr>
                <th>Track Title</th>
                <th>Genre</th>
                <th>Danceability</th>
              </tr>
            </thead>
            <tbody>
              {danceabilityData.map((row, idx) => (
                <tr key={idx}>
                  <td>{row.title}</td>
                  <td>{row.genre_name}</td>
                  <td>{row.danceability}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </section>

        {/* Section 2: Rank Tracks by Loudness */}
        <section className="feature-section">
          <h2>Rank Tracks by Loudness</h2>
          <table className="results-table">
            <thead>
              <tr>
                <th>Rank</th>
                <th>Track Title</th>
                <th>Genre</th>
                <th>Loudness (dB)</th>
              </tr>
            </thead>
            <tbody>
              {loudnessData.map((row, idx) => (
                <tr key={idx}>
                  <td>{row.loudness_rank}</td>
                  <td>{row.title}</td>
                  <td>{row.genre_name}</td>
                  <td>{row.loudness}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </section>

        {/* Section 3: Top Audio Profiles by Genre */}
        <section className="feature-section">
          <h2>Top Audio Profiles by Genre</h2>
          <table className="results-table">
            <thead>
              <tr>
                <th>Genre</th>
                <th>Valence</th>
                <th>Energy</th>
                <th>Danceability</th>
                <th>Profile Count</th>
              </tr>
            </thead>
            <tbody>
              {audioProfilesData.map((row, idx) => (
                <tr key={idx}>
                  <td>{row.genre_name}</td>
                  <td>{row.valence}</td>
                  <td>{row.energy}</td>
                  <td>{row.danceability}</td>
                  <td>{row.profile_count}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </section>
      </div>
    </div>
  );

  return (
    <div>

      {/* Navigation Bar */}
      {/* 不要动 */}
      <div id="navbar">
        <ul>
          <li><a href="http://localhost:3000/">HomePage</a></li>
          <li><a href="http://localhost:3000/search">Search Page</a></li>
          <li><a href="http://localhost:3000/genre">Genre Page</a></li>
          <li><a href="http://localhost:3000/collaboration">Collaboration</a></li>
        </ul>
      </div>

    </div>
  );
}
